import React, { useEffect } from 'react';
import { Nav, Navbar } from 'react-bootstrap';
import styled from 'styled-components';
import { Link as LinkScroll } from 'react-scroll';
import { Link, Route } from 'react-router-dom';
import TerminalLinks from './TerminalLinks';
import HomeLinks from './HomeLinks';


const Styles = styled.div`
  .navbar {
    background-color: white;
  }
  a,
  .navbar-nav .nav-link {
    color: black;
    text-decoration-color: red;

    &:hover {
      text-decoration-line: line-through;
      text-decoration-color: red;
      transition: $animate;
      position: relative;
      &:before,
      &:after {
        content: '';
        position: absolute;
        bottom: -10px;
        width: 0px;
        height: 5px;
        margin: 5px 0 0;
        transition: $animate;
        transition-duration: 0.75s;
        opacity: 0;
        background-color: darken(orange, 5%);
      }
    }
  }
`;

const NavigationBar = (props) => {
  console.log(props);
  let links =
    window.location.pathname === '/' ? (
      <>
        <Nav.Item>
          <Nav.Link>
            <a href="/">Home</a>
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link>
            <LinkScroll
              activeClass="active"
              to="about"
              spy
              smooth
              offset={-70}
              duration={500}
            >
              About
            </LinkScroll>
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link>
            <LinkScroll spy smooth offset={-70} duration={500} to="contact">
              Contact
            </LinkScroll>
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link>
            <Link to="/terminal">Feel old?</Link>
          </Nav.Link>
        </Nav.Item>
      </>
    ) : (
      <Nav.Item>
        <Nav.Link>
          <Link to="/terminal">Feel old?</Link>
        </Nav.Link>
      </Nav.Item>
    );
  const handelChangeNavbarLinks = () => {
    console.log(links);
    if (window.location.pathname === '/') {
      console.log('hi');
      links = (
        <>
          <Nav.Item>
            <Nav.Link>
              <a href="/">Home</a>
            </Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link>
              <LinkScroll
                activeClass="active"
                to="about"
                spy
                smooth
                offset={-70}
                duration={500}
              >
                About
              </LinkScroll>
            </Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link>
              <LinkScroll spy smooth offset={-70} duration={500} to="contact">
                Contact
              </LinkScroll>
            </Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link>
              <Link to="/terminal">Feel old?</Link>
            </Nav.Link>
          </Nav.Item>
        </>
      );
    }
    console.log(links);
  };
  useEffect(() => {
    handelChangeNavbarLinks();
  });

  return (
    <Route>
      <Styles>
        <Navbar expand="lg">
          <Navbar.Brand href="/">Code Life</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ml-auto">{links}</Nav>
            {console.log(links)}
          </Navbar.Collapse>
        </Navbar>
      </Styles>
    </Route>
  );
};
export default NavigationBar;
